import logo from './logo.svg';
import './App.css';
import Data from './data.json';

function App() {
  return (
    <div className="App">
      <div className="mail">
        { Data.map(mail => {
          return(
            <div key={ mail.id }>
            <h4> { mail.id }</h4>
            </div>
          )

        })}
      </div>
    </div>
  );
}

export default App;
